import React from 'react'
import './card.css'

const Card = (props) => {
	return (
		<div className="card bg-light-green grow">
			<figure>
				<img src="https://upload.wikimedia.org/wikipedia/commons/5/57/P%C3%A9dro_DELGADO.jpg" alt="Pedgro Delgado"/>
			</figure>
			<div className="mw-70 mw6">
				<h2 className="cyclist-name">{props.name}</h2>
				<p className="cyclist-description pa1 tc">{props.description}</p>
			</div>
		</div>
	)
}

export default Card;
